  let data = [
    { name: "ID-002", data: d2, selector: "myCanvas2" },
    { name: "ID-007", data: d1, selector: "myCanvas" }
  ];

  function draw(count, pos, ctx) {
    ctx.beginPath();
    let alpha = (count) / 10;
    //alpha = 1
    ctx.strokeStyle = `rgba(0, 0, 0, ${alpha}`;
    ctx.fillStyle = `rgba(0, 0, 0, ${alpha}}`;
    ctx.moveTo(pos, 0);
    ctx.lineTo(pos, 50);
    ctx.stroke();
  };

  function drawlabel(ctx, name) {
    ctx.font = "10px Georgia";
    let ct = 0;
    ctx.fillText(0, 0, 60);
    for (let i = 0; i <= 1440; i += 60) {
      ctx.fillText(ct++, i - 6, 60);
    }

    ctx.font = "20px Georgia";
    ctx.fillText(name, 1440 / 2 - 20, 80);
  }

  //for (const v of data) {
  //  draw(v.count, v.pos, document.getElementById("myCanvas2").getContext("2d"));
  //}
  //
  for (const v of data) {
    console.log(v);
    let ctx2 = document.getElementById(v.selector).getContext("2d");
    drawlabel(ctx2, v.name);
    for (const vv of v.data) {
      draw(vv.count, vv.pos, ctx2);
    }
  }
</script>
